import React from "react";
import "../../App.css";
import Footer from "../Footer";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";

import ScrollToTop from "react-scroll-up";

const responsive = {
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3,
    paritialVisibilityGutter: 60,
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2,
    paritialVisibilityGutter: 50,
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1,
    paritialVisibilityGutter: 30,
  },
};
const images = [
  {
    img: "/imgservices/services-1.jpg",
    title: "1",
  },

  "/imgservices/services-2.jpg",
  "/imgservices/services-3.jpg",
  "/imgservices/services-4.jpg",
  "/imgservices/services-5.jpg",
  "/imgservices/services-6.jpg",
  "/imgservices/services-7.jpg",
  "/imgservices/services-8.jpg",
  "/imgservices/services-9.jpg",
  "/imgservices/services-10.jpg",
  "/imgservices/services-11.jpg",
  "/imgservices/services-12.jpg",
  "/imgservices/services-13.jpg",
  "/imgservices/services-14.jpg",
  "/imgservices/services-15.jpg",
  "/imgservices/services-16.jpg",
  "/imgservices/services-17.jpg",
  "/imgservices/services-18.jpg",
  "/imgservices/services-19.jpg",
  "/imgservices/services-20.jpg",
  "/imgservices/services-21.jpg",
  "/imgservices/services-22.jpg",
  "/imgservices/services-23.jpg",
  "/imgservices/services-24.jpg",
  "/imgservices/services-25.jpg",
  "/imgservices/services-26.jpg",
  "/imgservices/services-27.jpg",
  "/imgservices/services-28.jpg",
  "/imgservices/services-29.jpg",
  "/imgservices/services-30.jpg",
  "/imgservices/services-31.jpg",
  "/imgservices/services-32.jpg",
  "/imgservices/services-33.jpg",
  "/imgservices/services-34.jpg",
  "/imgservices/services-35.jpg",
  "/imgservices/services-36.jpg",
  "/imgservices/services-37.jpg",
  "/imgservices/services-38.jpg",
  "/imgservices/services-39.jpg",
  "/imgservices/services-40.jpg",
];
export default function Services() {
  let sliceimg = images.map(function (data, i) {
    return (
      <div style={{ margin: "0 10px" }}>
        <img
          src={data.img}
          alt="ServicesDataAllweb"
          width="100%"
          height="auto"
        />
        <p>{data.title}</p>
      </div>
    );
  });
  return (
    <>
      <div className="hero-img-container">
        <div className="hero-containers" style={{ padding: "50px 50px" }}>
          <Carousel
            ssr
            partialVisbile
            itemClass="image-item"
            responsive={responsive}
            autoPlaySpeed={3000}
            autoPlay={true}
            infinite
          >
            {sliceimg}
          </Carousel>
        </div>
      </div>
      <ScrollToTop showUnder={160}>
        <span>
          <img src="/img-960px/up_arrow_round.png" alt="" />
        </span>
      </ScrollToTop>

      <Footer />
    </>
  );
}
